import React, { Component } from "react";

class Square extends Component {
	constructor(props) {
		super(props);

		this.increase = this.increase.bind(this);
	}


  render() {
  	var squareStyle = {
  		height: 250,
  		width: 250,
  		padding: 0,
  		backgroundColor: 'red'
  	}
    return (
    	<div style={squareStyle}>
    		<h1>{this.props.count}</h1>

    	</div>
    );
  }
}

export default Square	;
